import React, { FC, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {useDropzone, FileWithPath } from 'react-dropzone';
import Slider from '@mui/material/Slider';
import { getMessage } from '../utils/api';
import { isAuthenticated } from '../utils/auth';
import Grid2 from '@mui/material/Unstable_Grid2'; // Grid version 2
import Paper from '@mui/material/Paper';
import { styled } from '@mui/material/styles';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import RootRef from '@mui/core/RootRef'



const useStyles = makeStyles((theme) => ({
  link: {
    color: '#61dafb',
  },
  column: {
    margin: '10px',
    backgroundColor: 'rgba(0,0,0,0.5) !important',
    // border: '2px dashed #D3D3D3',
    minHeight: '50vh',
    backdropFilter: "blur(10px)",
    boxShadow: '10px 10px 10px rgba(30,30,30,0.5)',
  },
  buttonRight: {
    display: 'flex !important',
    justifyContent: 'right !important',
  },
  glassBack: {
    backgroundImage:'linear-gradient(to bottom right, rgba(255,255,255,0.2), rgba(255,255,255,0))',
    backdropFilter: "blur(10px)",
    boxShadow: '10px 10px 10px rgba(30,30,30,0.5)',
  },
  gradient: {
    backgroundImage: 'radial-gradient(circle at 10% 20%, rgb(87, 108, 117) 0%, rgb(37, 50, 55) 100.2%)',
  }

}));

export const Home: FC = () => {
  const [message, setMessage] = useState<string>('');
  const [error, setError] = useState<string>('');
  const classes = useStyles();

  const queryBackend = async () => {
    try {
      const message = await getMessage();
      setMessage(message);
    } catch (err) {
      setError(String(err));
    }
  };

  const {acceptedFiles, getRootProps, getInputProps} = useDropzone();

  const files = acceptedFiles.map((file: FileWithPath) => (
    <li key={file.path}>
      {file.path} - {file.size} bytes
    </li>
  ));

  const {ref, ...rootProps} = getRootProps()

  const Item = styled(Paper)(({ theme }) => ({
    // backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    // ...theme.typography.body2,
    padding: theme.spacing(1),
    color: '#fff',
    boxShadow: "none",
  }));

  const PrettoSlider = styled(Slider)({
    color: '#52af77',
    height: 10,
    '& .MuiSlider-track': {
      border: 'none',
    },
    '& .MuiSlider-thumb': {
      height: 24,
      width: 24,
      backgroundColor: '#fff',
      border: '2px solid currentColor',
      '&:focus, &:hover, &.Mui-active, &.Mui-focusVisible': {
        boxShadow: 'inherit',
      },
      '&:before': {
        display: 'none',
      },
    },
    '& .MuiSlider-valueLabel': {
      lineHeight: 1.2,
      fontSize: 12,
      background: 'unset',
      padding: 0,
      width: 32,
      height: 32,
      backgroundColor: '#52af77',
    },
  });

  return (
    <>
      {/* {!message && !error && (
        <a className={classes.link} href="#" onClick={() => queryBackend()}>
          Click to make request to backend
        </a>
      )}
      {message && (
        <p>
          <code>{message}</code>
        </p>
      )}
      {error && (
        <p>
          Error: <code>{error}</code>
        </p>
      )} */}
      <Grid2 container spacing={3} columns={12} className={classes.gradient}>
        <Grid2 xs={6}  mt={5}>
          <Item className={classes.column} >
              <RootRef rootRef={ref}>
                <div {...getRootProps({className: 'dropzone', role:'button'})} >
                  <input {...getInputProps()} />
                  <p>Drag 'n' drop some files here, or click to select files</p>
                </div>
                <aside>
                  <h4>Files</h4>
                  <ul>{files}</ul>
                </aside>
              </RootRef>
          </Item>
        </Grid2>
        <Grid2 xs={6}>
          <Item className={classes.column}>Test</Item>
        </Grid2>
        <Grid2 xs={6}>
          <Item className={classes.column}>
            <Box sx={{ width: 600 }}>
              <Typography gutterBottom>Box Threshold</Typography>
              <PrettoSlider
                max={1}
                min={0}
                defaultValue={0.25}
                step={0.1}
                valueLabelDisplay="auto"
                aria-label="pretto slider"
              />
            </Box>
            <Box sx={{ width: 600 }}>
              <Typography gutterBottom>Text Threshold</Typography>
              <PrettoSlider
                max={1}
                min={0}
                defaultValue={0.25}
                step={0.1}
                valueLabelDisplay="auto"
                aria-label="pretto slider"
              />
            </Box>
              <div className={classes.buttonRight}>
              <Button variant="contained">Contained</Button>
              </div>
          </Item>
        </Grid2>
        <Grid2 xs={6}>
          <Item className={classes.column}>Test</Item>
        </Grid2>
      </Grid2>
      <a className={classes.link} href="/admin">
        Admin Dashboard
      </a>
      <a className={classes.link} href="/protected">
        Protected Route
      </a>
      {isAuthenticated() ? (
        <a className={classes.link} href="/logout">
          Logout
        </a>
      ) : (
        <>
          <a className={classes.link} href="/login">
            Login
          </a>
          <a className={classes.link} href="/signup">
            Sign Up
          </a>
        </>
      )}
    </>
  );
};
